import React, { useState } from 'react';

import './App.css';
import Button from './components/UI/Button/Button';

function App() {

  const [para,setPara] = useState(false);

  const setParaHandler = () => {
    setPara(showPara => !showPara);
  }

  return (
    <div className="app">
      <h1>Hi there!</h1>
      {para && <p>This is new</p>}
      <Button onClick={setParaHandler}>Click</Button>
    </div>
  );
}

export default App;
